        locality_text = models.TextAttribute("A region's local area, such as a city, town, village")
        locality_subdivision_text = models.TextAttribute("A region's local area subdivision, such as a city district, town sector, village part. For example, district is an official sub-city features present in countries where such an additional administrative layer is used in postal addressing, or where such features are commonly referred to in local parlance. Examples include city districts in Brazil and Chile and arrondissements in France.")
        neighborhood_text = models.TextAttribute("A locality's neighborhood area, such as a district, subdivision, zone")
        postal_code_text = models.TextAttribute("A postal code used in country-specific national addressing systems. For example, a United States ZIP code, a Canada mail routing number, etc.")
        street_address_text = models.TextAttribute("street address text")
        premise_address_text = models.TextAttribute("A street address subcategory, such as an apartment identifier, suite code, mailbox number, room name")
        global_location_number_text = models.TextAttribute("See https://schema.org/globalLocationNumber https://en.wikipedia.org/wiki/Global_Location_Number")

